import React, { useState } from 'react';
import HandleEvents from './handleEvents';

function App() {
  const [myAppVisible, setMyAppVisible] = useState(false);

  const handleStartMyApp = () => {
    setMyAppVisible(true);
  };

  return (
    <div className="App">
      {!myAppVisible ? (
        <button onClick={handleStartMyApp} style={{ backgroundColor: 'purple', WebkitTextFillColor:'white'}}>
          get outfit
        </button>
      ) : (
        <HandleEvents />
      )}
    </div>
  );
}

export default App;
